import React, { Component } from 'react';

export class ThirdStep extends React.Component {
  regresa = e => {
    e.preventDefault()
    this.props.prevStep()
  }
  render() {
    return (
      <MuiThemeProvider>
        <React.Fragment>
          <AppBar title="Enter Data"/>
          <TextField
            hintText="Enter Your Name"
          />
          <br/>
          <RaisedButton
            label="Next"
            onClick={this.regresa}
          />
        </React.Fragment>
      </MuiThemeProvider>
    );
  }
}

export default ThirdStep
